//
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import LoginPage from './pages/Login/LoginPage'; // Asumiendo que tienes una página de login
import Home from './pages/Home/Home';
import Analytics from './pages/Analytics/Analytics';
import Settings from './pages/Settings/Settings';
import AboutPage from './pages/About/AboutPage';
import { AuthProvider, useAuth } from './AuthContext';




const App: React.FC = () => {
  const isAuthenticated = true; // Asumiendo que tienes lógica para determinar si el usuario está autenticado

  return (
    <Router>
        <AuthProvider>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/analytics" element={<Analytics />} />
        <Route path="/settings" element={<Settings />} />
        <Route path="/login" element={<LoginPage />} />
        {/* Ejemplo de redirección condicional */}
        {!isAuthenticated ? <Navigate to="/login" /> : <Navigate to="/" replace />} 
      </Routes>
      </AuthProvider>
    </Router>
  );
};

export default App;
